}
#tbr {
	right: 0px;
	background: url(http://image.rakuten.co.jp/kurashiya/cabinet/kikaku/imgrc0069096987.jpg) repeat-y scroll;/*縦バナー右の画像URL*/
}
div.link a {
	display: block;
	width: 100%;
	height: 100%;
	left: 0;
	top: 0;
}

